import './App.css';
import Landing from './Pages/Landing.js';
import Register from './Pages/Register';
import {Routes, BrowserRoutes, Route} from 'react-router-dom'

function App() {
  return (
    <BrowserRoutes>
      <Routes>
        <Route path="/" element={<Landing />}></Route>
        <Route path='register'></Route>
      </Routes>

      <Register />
    </BrowserRoutes>
  );
}

export default App;
